import { useSelector } from "react-redux"

export default function Prodact(){
    const prodact=useSelector(state=>state.prodact);
    console.log(prodact);
    return(
        <div>
         {prodact.map((pro)=>(<h2>{rp}</h2>))}
              
          
        </div>
    )
}
